import React, { useState, useContext } from 'react';
import { MedicalRecordsContext } from '../contexts/MedicalRecordsContext';
import { updateMedicalRecord } from '../services/medicalRecordService';
import { useHistory } from 'react-router-dom';

const UpdateMedicalRecordsPage = () => {
    const currentContext = useContext(MedicalRecordsContext);
    const history = useHistory();

    const [forename, setForename] = useState(currentContext.medicalRecord?.Forename || '');
    const [surname, setSurname] = useState(currentContext.medicalRecord?.Surname || '');
    const [nhsNumber, setNhsNumber] = useState(currentContext.medicalRecord?.NHSNumber || '');
    const [personDOB, setPersonDOB] = useState(currentContext.medicalRecord?.PersonDOB || '');
    const [genderCode, setGenderCode] = useState(currentContext.medicalRecord?.GenderCode || '');
    const [postcode, setPostcode] = useState(currentContext.medicalRecord?.Postcode || '');

    const handleFormSubmit = async (event) => {
        event.preventDefault();

        const updatedMedicalRecord = {
            Forename: forename,
            Surname: surname,
            NHSNumber: nhsNumber,
            PersonDOB: personDOB,
            GenderCode: genderCode,
            Postcode: postcode
        };

        await updateMedicalRecord(currentContext.medicalRecord?.ID, updatedMedicalRecord);

        history.push('/medicalrecords');
    };

    return (
        <div className="govuk-width-container">
            <form onSubmit={handleFormSubmit}>
                <div className="govuk-grid-row">
                    <div className="govuk-grid-column-two-thirds">
                        {currentContext.medicalRecord ? (
                            <fieldset>
                                <legend>Current Medical Record</legend>
                                <p><strong>Forename:</strong> {currentContext.medicalRecord.Forename}</p>
                                <p><strong>Surname:</strong> {currentContext.medicalRecord.Surname}</p>
                                <p><strong>NHS Number:</strong> {currentContext.medicalRecord.NHSNumber}</p>
                                <p><strong>PersonDOB:</strong> {currentContext.medicalRecord.PersonDOB}</p>
                                <p><strong>GenderCode:</strong> {currentContext.medicalRecord.GenderCode}</p>
                                <p><strong>Postcode:</strong> {currentContext.medicalRecord.Postcode}</p>
                            </fieldset>
                        ) : null}
                    </div>
                </div>

                <div className="govuk-grid-row">
                    <div className="govuk-grid-column-two-thirds">
                        <fieldset>
                            <legend>Update Medical Record</legend>
                            <div className="govuk-form-group">
                                <label className="govuk-label" htmlFor="forename">Forename</label>
                                <input className="govuk-input" id="forename" type="text" value={forename} onChange={(event) => setForename(event.target.value)} />
                            </div>

                            <div className="govuk-form-group">
                                <label className="govuk-label" htmlFor="surname">Surname</label>
                                <input className="govuk-input" id="surname" type="text" value={surname} onChange={(event) => setSurname(event.target.value)} />
                            </div>

                            <div className="govuk-form-group">
                                <label className="govuk-label" htmlFor="nhsNumber">NHS Number</label>
                                <input className="govuk-input" id="nhsNumber" type="text" value={nhsNumber} onChange={(event) => setNhsNumber(event.target.value)} />
                            </div>

                            < div className="govuk-form-group" >
                                <label className="govuk-label" htmlFor="personDOB">PersonDOB</label>
                                <input className="govuk-input" id="personDOB" type="date" value={personDOB} onChange={(event) => setPersonDOB(event.target.value)} />
                            </div>

                            <div className="govuk-form-group">
                                <label className="govuk-label" htmlFor="genderCode">Gender Code</label>
                                <input className="govuk-input" id="genderCode" type="text" value={genderCode} onChange={(event) => setGenderCode(event.target.value)} />
                            </div>

                            <div className="govuk-form-group">
                                <label className="govuk-label" htmlFor="postcode">Postcode</label>
                                <input className="govuk-input" id="postcode" type="text" value={postcode} onChange={(event) => setPostcode(event.target.value)} />
                            </div>

                            <button className="govuk-button" type="submit">Update Medical Record</button>

                        </fieldset>
                    </div>
                </div>
            </form>
        </div>
    );
}
export default UpdateMedicalRecordsPage;
